import "./ResumeScreen.css";
import resume from './Assets/Resume.pdf';

function ResumeScreen()
{
    return(
        <div className = "resume">
        <img src={resume} className = "resume"/>
        <File src={resume} />
        </div>
    );
}

export default ResumeScreen;
